import './App.css';

import React from 'react'
import Img from './component/img.js'
import Form from './component/form'


class App extends React.Component {
    constructor() {
    super()
    this.state = {
        isLoading: true,
        apiExploraoryData: {},
    };
    this.predict = this.predict.bind(this)
}


    componentDidMount() {
        let ourl = this.state.url
        let i = 1
        for(let key in this.state.urlData) {
            // console.log(i)
            ourl += "v"+ i++ + "=" + this.state.urlData[key] + "&"
        }
        this.setState({ 
            url: ourl.slice(0,-1)
        })
        fetch("/api")
        .then(response => response.json())
        .then(data => this.setState({
            apiExploraoryData: data,
            isLoading: false
        }))
    }


    predict() {
        console.log("from click: " + this.state.url)
        fetch(this.state.url)
        .then(response => response.json())
        .then(data => this.setState({
            apiPredictionData: data
        }))
    }


    render() {
        console.log("from rneder")
        let url = ""
        url += this.state.apiExploraoryData.figures
        url = url.split(',')
        console.log(url[0])

        const figures = url.map(url => {
            return(
            <Img url={url} />
            )
        })
        return(

            <div className="container">
              <Form />

                <h1>{this.state.apiPredictionData.predicted }</h1>
                < hr/>
                <h2 >Exploratory Data Analysis</h2>
                <div className="img-container">
                    {figures}
                </div>
            </div>
        )
    }

}

export default App;
